import React , { Component }from 'react';
import Toolbar from '../Toolbar/Toolbar';

class Dashboard extends Component{
    render (){
        return(
           <div>
                <Toolbar/>
                <main style={{marginTop:'64px'}}>
                    <p>Dashboard </p>
                </main>
           </div>
        )
    }
} 
export default Dashboard
